import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';

import tick from "./RenderingElement";



const root = ReactDOM.createRoot(
    document.getElementById('root')
);

function App() {

  let a = tick(root);
  return (

      setInterval(a, 1000)
);

}


export default App;
